      title: "class - section",
      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  section\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/highlighted-text/highlighted-text.component.ts\n        \n\n\n\n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                content\n                            \n                            \n                                index\n                            \n                            \n                                is_pure\n                            \n                        \n                    \n                \n\n\n\n\n\n\n        \n    \n\n\n\n            \n    \n    \n        Properties\n    \n    \n        \n            \n                \n                    \n                    \n                        content\n                        \n                    \n                \n            \n                \n                    \n                        Type :         string\n\n                    \n                \n                \n                    \n                        Default value : ''\n                    \n                \n                    \n                        \n                                Defined in src/app/highlighted-text/highlighted-text.component.ts:9\n                        \n                    \n\n\n        \n    \n    \n        \n            \n                \n                    \n                    \n                        index\n                        \n                    \n                \n            \n                \n                    \n                        Type :         number\n\n                    \n                \n                \n                    \n                        Default value : 0\n                    \n                \n                    \n                        \n                                Defined in src/app/highlighted-text/highlighted-text.component.ts:10\n                        \n                    \n\n\n        \n    \n    \n        \n            \n                \n                    \n                    \n                        is_pure\n                        \n                    \n                \n            \n                \n                    \n                        Type :         boolean\n\n                    \n                \n                \n                    \n                        Default value : true\n                    \n                \n                    \n                        \n                                Defined in src/app/highlighted-text/highlighted-text.component.ts:8\n                        \n                    \n\n\n        \n    \n\n\n\n\n\n\n\n\n    \n\n\n    \n        import { Component, Input, OnChanges } from '@angular/core';\nimport { TuiTagModule } from '@taiga-ui/kit';\nimport { HcseDataService } from '../hcse-data.service';\nimport { TuiNavigationModule } from '@taiga-ui/experimental';\nimport { RouterModule } from '@angular/router';\n\nclass section {\n  is_pure: boolean = true;\n  content: string = '';\n  index: number = 0;\n}\n\n@Component({\n  selector: 'app-highlighted-text',\n  standalone: true,\n  imports: [\n    TuiTagModule, TuiNavigationModule, RouterModule],\n  templateUrl: './highlighted-text.component.html',\n  styleUrl: './highlighted-text.component.scss'\n})\nexport class HighlightedTextComponent implements OnChanges {\n  @Input() text: string = '';\n  keywords: string[] = [];\n  sections: section[] = [];\n\n  constructor(private data_service: HcseDataService) {\n  }\n\n  ngOnChanges(): void {\n    this.keywords = this.data_service.get_keywords_for_text(this.text);\n    let arr = this.text.split(\" \");\n    let i = 0\n    for (const w of arr) {\n      let pot_keyword = w.toLowerCase();\n      pot_keyword.replace(/[.?,;()!]/g, '');\n      this.sections.push({ is_pure: this.keywords.indexOf(pot_keyword) == -1, content: w, index: i });\n      i++;\n    }\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
